function LodgTitle( { title, location } ) {
    return (

        <div className="lodgTitle-container">
            <h1 className="lodgTitle-title">{title}</h1>
            <h3 className="lodgTitle-location">{location}</h3>
        </div>
    )
}

export default LodgTitle;
